using namespace std;
int firstoccur(int arr[],int n,int x)
{
    
    int low=0;
    int high=n-1;
    while(low<=high)
    {
        int mid=(low+high)/2;
        if(x<arr[mid])
        high=mid-1;
        else if(x>arr[mid])
        low=mid+1;
        else 
        {
            if(mid==0||arr[mid-1]!=arr[mid])
            return mid;
            else            
            high=mid-1;            
        }
    }
    return -1;
}

int lastoccur(int arr[],int n,int x)
{
    
    int low=0;
    int high=n-1;
    while(low<=high)
    {
        int mid=(low+high)/2;
        if(x<arr[mid])
        high=mid-1;
        else if(x>arr[mid])
        low=mid+1;
        else 
        {
            if(mid==n-1||arr[mid+1]!=arr[mid])
            return mid;
            else            
            low=mid+1;            
        }
    }
    return -1;
}
int totaloccur(int arr[],int n,int x)
{
    int res=firstoccur(arr,n,x);
    int res1=lastoccur(arr,n,x);
    
    if(res==-1)
    {
    return -1;
    }    
    return (res1-res)+1;
}
int majorityElement(int a[], int size)
    {
        
        sort(a,a+size);
        int x=0;
        if(size%2==1)
        {
			x=a[size/2];
	    }
        else
        {
        	x=a[(size/2)-1];
		}        
        int res=totaloccur(a,size,x);
        if(res>size/2)
        return x;
        else
        return -1;
       
    }
